import React from "react";
import Grid from "@material-ui/core/Grid";
import MainHead from "./MainHead";

const MainContainer = () => {
  return (
    <Grid container>
      <Grid item xs={12} sm={6}>
        <MainHead />
      </Grid>
      <Grid item xs={12} sm={6}>
        This is Second
      </Grid>
    </Grid>
  );
};

export default MainContainer;
